Englishdom - онлайн-школа английского языка, один из лидеров в Восточной Европе. Школа объединяет индивидуальные уроки с преподавателем онлайн и самостоятельное изучение английского языка на собственной образовательной платформе, где вы можете тренировать различные языковые навыки и пройти онлайн-курс.


 ED Class - приложение для студентов Englishdom, с помощью которого можно:
- просматривать и управлять расписанием занятий;
- контролировать и пополнять баланс;
- проводить онлайн-урок с преподавателем (в разработке);
- выполнять домашние задания по английскому (частично);
- учить английские слова (частично);
- связаться с личным куратором;
- получать уведомления о занятиях.

Приложение - часть экосистемы для изучения английского языка EnglishDom.
EnglishDom это:  
Индивидуальные занятия английским онлайн.
Разговорные клубы.
Интерактивные онлайн-курсы.
Бесплатные тренажер для изучения новых слов и грамматики.
Приложение для изучения английских слов.
Приложение курсов английского языка.
Канал на YouTube.

Есть цель выучить английский язык? Присоединяйся к EnglishDom — мы поможем тебе её достигнуть!
